  false,\n\t\"url\": null,\n\t\"notes\": \"This dataset is a single orthophoto from
  a collection of GeoTIFF format natural color orthophotos covering the Southwest
  Florida Water Management District. An orthophoto is remotely sensed image data in
  which displacement of features in the image caused by terrain relief and sensor
  orientation have been mathematically removed. Orthophotography combines the image
  characteristics of a photograph with the geometric qualities of a map. Each orthophoto
  provides imagery for a 5,000 foot by 5,000 foot cell area on the ground. The source
  imagery was obtained in February and March of 2007 and used to produce orthophotos
  with a one foot ground sample distance (GSD). Imagery was acquired at 0.9 foot GSD
  resolution. Flight height maintained during mission was 8,650 feet AGL. The imagery
  was captured at 12-bit radiometric resolution and converted to 8-bit radiometric
  resolution during post processing. The imagery was captured with 25% sidelap between
  all adjacent flight lines. The SWFWMD project area was divided into 5 flight blocks
  due to neccessary base station and flight line length requirements. The imagery
  was obtained and processed by all digital means beginning with data acquisition
  using an ADS40 digital sensor. The orthophotos are available in GeoTIFF form. The
  projected coordinate system is State Plane Florida West (Zone 902), NAD 83 HARN,
  GRS 80, Units Feet.\",\n\t\"owner_org\": \"b0b4c45b-a8ca-416b-b463-ee90d0a1a3df\",\n\t\"extras\":
